import React, { useState, useEffect } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./HomePage";
import HeaderNav from "./HeaderNav";
import DropdownMenu from './DropdownMenu';
import MyBets from "./MyBets";
import ActiveBets from "./ActiveBets";
import PageLayout from "./PageLayout";
import Shortlists from "./Shortlists";
import ExpiredBets from "./ExpiredBets";
import Leaderboard from "./Leaderboard";
import AdminPanel from "./AdminPanel";
import PlacementData from "./PlacementData";
import Login from "./Login";
import Profile from "./Profile";
import { mockCompanies } from "./mockData";

const defaultAnnouncements = [
  "Write a mail to us noreply@gmail.com",
  "Welcome to Jobsy! Enjoy betting responsibly.",
];

export default function App() {
  const [showAnnouncement, setShowAnnouncement] = useState(true);
  const [announcementIdx, setAnnouncementIdx] = useState(0);
  const [isSliding, setIsSliding] = useState(false);
  const [companies, setCompanies] = useState([...mockCompanies]);
  const announcements = defaultAnnouncements;

  useEffect(() => {
    if (!showAnnouncement || announcements.length <= 1) return;
    const interval = setInterval(() => {
      setIsSliding(true);
      setTimeout(() => {
        setAnnouncementIdx(idx => (idx + 1) % announcements.length);
        setIsSliding(false);
      }, 400); // match animation duration
    }, 4000);
    return () => clearInterval(interval);
  }, [showAnnouncement, announcements.length]);
  return (
    <BrowserRouter>
      <HeaderNav />
      <Routes>
        <Route path="/" element={<HomePage companies={companies} setCompanies={setCompanies} showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/home" element={<HomePage companies={companies} setCompanies={setCompanies} showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/login" element={<Login />} />
        <Route path="/profile" element={<Profile showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/my-bets" element={<MyBets showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/active-bets" element={<ActiveBets companies={companies} setCompanies={setCompanies} showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/shortlists" element={<Shortlists showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/expired-bets" element={<ExpiredBets companies={companies} setCompanies={setCompanies} showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/leaderboard" element={<Leaderboard showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/admin-panel" element={<AdminPanel companies={companies} setCompanies={setCompanies} showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
        <Route path="/placement-data" element={<PlacementData showAnnouncement={showAnnouncement} setShowAnnouncement={setShowAnnouncement} announcementIdx={announcementIdx} announcements={announcements} isSliding={isSliding} />} />
      </Routes>
    </BrowserRouter>
  );
}
